sub pratisePerl5 {
	
	my $base_name = "BITSCRAFT";
	my $match_string = "BITS CRAFT";
	my @each_characters = split "", $base_name;
	my $total_chars = scalar @each_characters;
	my @running_array = @each_characters;
	my @left_chars;
	my $search_string;
	my @patterns;
	my @matching_patterns;
	
	foreach (@each_characters) {
		my $removed_char = shift @running_array;
		push @left_chars, $removed_char;
		my @right_chars = @running_array;
		$search_string = join("", @left_chars) . " " . join("", @right_chars);
		print "One Word Longer: <$search_string>\n";
		
		@patterns = (
			qr/(?i:^\Q$search_string\E)/,
			qr/(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])+(?i:\Q$search_string\E)/,
		);
		push @matching_patterns, @patterns;
		@patterns = ();
	}
	
	foreach (@matching_patterns) {
		print "$_\n";
	}
	
	if ($match_string ~~ @matching_patterns) {
		print "\nMatched!\n";
	} else {
		print "\nNot Matched!\n";
	}

}

sub pratisePerl6 {
	
	my $base_name = "A I A Insurance Private Limited";
	my $base_name_length = length $base_name;
	my @base_words = split / /, $base_name;
	@base_words = map {trim($_)} @base_words;
	my $number_of_words = scalar(@base_words);	
	
	my $string = "";
	my $is_first_set_of_words_over = 0;
	my $temp_counter = 0;
	foreach my $word (@base_words) {
		$temp_counter++;
		last if (length $word != 1 && $temp_counter == 1);
		unless ($is_first_set_of_words_over) {
			if (length $word == 1) {
				$string = $string . $word;
			} elsif (length $word != 1 && $temp_counter == 2) {
				$string = $string . $word;
			} else {
				$is_first_set_of_words_over = 1;
				$string = $string . " " . $word;
			}
		} else {
			$string = $string . " " . $word;
		}
		print "<$word>|$string\n";
	}

}

sub pratisePerl4 {
	my $base_name = "AMDOCSIN";
	my @each_characters = split "", $base_name;
	my $total_chars = scalar @each_characters;
	my @patterns;
	
	foreach my $index (0 .. $total_chars-1) {
		my @left_chars = @each_characters[0 .. $index];
		my @right_chars = array_minus(@each_characters, @left_chars);
		
		
		my @separators = qw("" " " "." ". " "-" "- " "~" "~ " "|" "| " "%" "% " "*" "* " "^" "^ " "$" "$ " "@" "@ " "&" "& " "(" ")" "_" "_ ");
		my $left_word = join("", @left_chars);
		my $right_word = join("", @right_chars);
		
		print "<$left_word> | <$right_word>\n";
		foreach (@separators) {
			@patterns = ();
			my $search_string = $left_word . $_ . $right_word;
			@patterns = (
				qr/(?i:^\Q$search_string\E)/,
				qr/(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])+(?i:\Q$search_string\E)/,
			);
		} # end of separators
		foreach (@patterns) {
			print "$_\n";
		}
	} # end of $index
	
}



