sub pratisePerl3 {
	my $text = "SABS Labs private limited";
	my $text2 = "MSABS Labs private limited";
	my $text3 = "DR ABS Labs private limited";
	my $text4 = " ABS Labs private limited";
	my $text5 = " (ABS Labs private limited";
	my $text6 = "MS (ABS Labs private limited";
	my $text7 = "MS(ABS Labs private limited";
	my $text8 = "DR(ABS Labs private limited";
	my $text9 = "dr (ABS Labs private limited";
	my $text10 = "(ABS Labs private limited";
	my $text11 = "~ABS Labs private limited";
	my $text12 = "dfkjdkjflkdsjfjlk djfdjgn (group of ABS Labs) private limited";
	my $text13 = "dfkjdkjflkdsjfjlk djfdjgn (ABS Lab group) private limited";
	my $base_name = "abs lab";
	
	my @text_array = ($text, $text2, $text3, $text4, $text5, $text6, $text7, $text8, $text9, $text10, $text11, $text12, $text13);
	
	my @patterns = (
		#qr/(?i:^\Q$base_name\E)/,
		#qr/(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])+(?i:\Q$base_name\E)/,
		qr/(?i:group)(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])*?(?i:of)(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])*?(?i:\Q$base_name\E)/,
		qr/(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])*?(?i:\Q$base_name\E)(?i:ms|m\/s|[^a-zA-Z]|dr|ms[^a-zA-Z]|m\/s[^a-zA-Z]|dr[^a-zA-Z])*?(?i:group)/,
	);
	
	foreach my $match_string (@text_array) {
		if ($match_string ~~ @patterns) {
			print "Matched\n";
			my ($match) = grep{$_ =~ $match_string} @patterns;
			print "$_ Search: Matched pattern is $match\n" if defined $match;
		} else {
			print "$_ Search: Not Matched\n";
		}	
	}

}
